DECLARE @var0 sysname;
SELECT @var0 = [d].[name]
FROM [sys].[default_constraints] [d]
INNER JOIN [sys].[columns] [c] ON [d].[parent_column_id] = [c].[column_id] AND [d].[parent_object_id] = [c].[object_id]
WHERE ([d].[parent_object_id] = OBJECT_ID(N'[TransDeployDevice]') AND [c].[name] = N'EmpName');
IF @var0 IS NOT NULL EXEC(N'ALTER TABLE [TransDeployDevice] DROP CONSTRAINT [' + @var0 + '];');
ALTER TABLE [TransDeployDevice] ALTER COLUMN [EmpName] nvarchar(50) NOT NULL;

